import React, { useEffect, useState } from "react";
import axios from "axios";

function App() {
  const [info, Setinfo] = useState([]);
  const [index, setIndex] = useState(null);
  const fetchData = async () => {
    const infodata = await axios.get("https://reqres.in/api/users?page=2");
    Setinfo(infodata.data.data);
  };
  useEffect(() => {
    fetchData();
  }, []);

  return (
    <div className="App">
      <h1>hai</h1>



      {info.map((place, i) => (
        <button key={place.id} onClick={(e)=>setIndex(e.target.va)}>{i+1}</button>
      ))}
    </div>
  );
}

export default App;
